return ['x-generator'=>'GlotPress/4.0.0-rc.1','translation-revision-date'=>'2024-02-23 07:00:56+0000','plural-forms'=>'nplurals=2; plural=n > 1;','project-id-version'=>'Plugins - Autoptimize - Stable (latest release)','language'=>'id','messages'=>['Autoptimize applies extra "compatibiity logic" to prevent issues with JS optimization (for e.g. Gutenberg blocks, Revolution Slider, jQuery-heavy plugins, ...) but may sometimes be a bit too careful. If you have render-blocking JS issues, you can try disabling this logic here. Make sure to test your site thoroughly though!'=>'Autoptimize menerapkan "logika kompatibilitas" ekstra untuk mencegah masalah pada pengoptimalan JS (misalnya blok Gutenberg, Revolution Slider, plugin yang menggunakan jQuery,...), namun terkadang terlalu berhati-hati. Jika Anda mengalami masalah pemblokiran render JS, Anda dapat mencoba menonaktifkan logika ini di sini. Pastikan untuk menguji situs Anda secara menyeluruh!','Pro Boosters'=>'Peningkatan Pro','Page Cache'=>'Cache Halaman','Thank you for installing and activating Autoptimize. Your site is being optimized immediately, please test the frontend to ensure everything still works as expected. If needed you can change JavaScript or CSS optimization settings under %1$sSettings -> Autoptimize%2$s .'=>'Terima kasih telah menginstal dan mengaktifkan Autoptimize. Situs Anda akan segera dioptimalkan, silakan uji tampilan depan untuk memastikan semuanya masih berfungsi seperti yang diharapkan. Jika diperlukan, Anda dapat mengubah pengaturan pengoptimalan JavaScript atau CSS di bawah %1$sPengaturan -> Autoptimize%2$s.','Shortpixel reports it cannot always reach your site, which might mean some images are not optimized. You can %1$sread more about why this happens and how you can fix that problem here%2$s.'=>'Shortpixel melaporkan bahwa mereka tidak selalu dapat menjangkau situs Anda, yang artinya beberapa gambar mungkin tidak dioptimalkan. Anda dapat %1$smembaca lebih lanjut tentang mengapa hal ini terjadi dan bagaimana Anda dapat memperbaiki masalah tersebut di sini%2$s.','On-the-fly image optimization and fast delivery via the Shortpixel global CDN.'=>'Pengoptimalan gambar seketika dan pengiriman cepat melalui CDN global Shortpixel.','Image optimization & CDN'=>'Pengoptimalan gambar & CDN','Make your site significantly faster by simply ticking a few boxes and start serving CDN powered, optimized images in next-get formats like WebP and AVIF! No additional plugins or services needed.'=>'Jadikan situs Anda lebih cepat secara signifikan hanya dengan mencentang beberapa kotak dan mulai menyajikan gambar yang dioptimalkan dengan CDN dalam format terbaru seperti WebP dan AVIF! Tidak perlu plugin atau layanan tambahan.','The image optimization service does not work on locally hosted sites or when the server is on a private network.'=>'Layanan pengoptimalan gambar tidak berfungsi pada situs yang dihosting secara lokal atau ketika server berada pada jaringan pribadi.','The Critical CSS service does not work on locally hosted sites or when the server is on a private network.'=>'Layanan Critical CSS tidak berfungsi pada situs yang dihosting secara lokal atau ketika server berada pada jaringan pribadi.','of the above rules got flagged by criticalcss.com as possibly needing review. This is often due to font-related issues which can be safely ignored, but in case of doubt do a visual test or check for Cumulative Layout Shift issues in e.g. Pagespeed Insights.'=>'dari aturan di atas ditandai oleh criticalcss.com sebagai hal yang mungkin perlu ditinjau. Hal ini sering kali disebabkan oleh masalah terkait font yang dapat diabaikan dengan aman, tetapi jika ragu, lakukan tes visual atau periksa masalah Pergeseran Tata Letak Kumulatif di Pagespeed Insights.','Every %s (Autoptimize Crit. CSS)'=>'Setiap %s (Autoptimize Crit. CSS)','Path validation error:\\n\\nThe path contains characters that are not permitted, remove or encode the unsafe characters.'=>'Kesalahan validasi jalur:\\n\\n Jalur berisi karakter yang tidak diizinkan, hapus atau enkode karakter yang tidak aman.','Rule validation error:\\n\\nType based rules requires a minified critical CSS.'=>'Kesalahan validasi aturan:\\n\\nAturan berbasis tipe memerlukan critical CSS yang diperkecil.','Rule validation error:\\n\\nBased on your rule type, you should set a path or conditional tag.'=>'Kesalahan validasi aturan:\\n\\nBerdasarkan jenis aturan Anda, Anda harus menetapkan jalur atau tag bersyarat.','Disable extra compatibilty logic?'=>'Menonaktifkan logika kompatibilitas ekstra?','Enable this if you want inline JS or CSS to be minified as well.'=>'Aktifkan ini jika Anda ingin JS atau CSS inline agar dapat diperkecil.','Also minify inline JS/ CSS?'=>'Juga memperkecil JS/ CSS inline?','I would like be contacted about my experience with Autoptimize.'=>'Saya ingin dihubungi tentang pengalaman saya dengan Autoptimize.','We would appreciate if you let us know why you\'re deactivating Autoptimize!'=>'Kami akan sangat menghargai jika Anda memberi tahu kami alasan Anda menonaktifkan Autoptimize!','Ouch, sorry about that! But almost all problems can be fixed with the right configuration, have a look at <a href="https://blog.futtta.be/2022/05/05/what-to-do-when-autoptimize-breaks-your-site/" target="_blank">this short troubleshooting howto</a> or create a topic on <a href="https://wordpress.org/support/plugin/autoptimize/#new-topic-0" target="_blank">the support forum here</a>!'=>'Aduh, mohon maaf tentang itu! Tetapi hampir semua masalah dapat diperbaiki dengan konfigurasi yang tepat, lihatlah <a href="https://blog.futtta.be/2022/05/05/what-to-do-when-autoptimize-breaks-your-site/" target="_blank">panduan singkat pemecahan masalah ini</a> atau buat sebuah topik pada <a href="https://wordpress.org/support/plugin/autoptimize/#new-topic-0" target="_blank">forum dukungan di sini</a>!','Sorry to see you go!'=>'Maaf melihat Anda pergi!','LCP Image to preload'=>'Gambar LCP untuk dimuat sebelumnya','WordPress adds block CSS and global styles to improve easy styling of block-based sites, but which can add a significant amount of CSS and SVG. If you are sure your site can do without the block CSS and "global styles", you can disable them here.'=>'WordPress menambahkan blok CSS dan gaya global untuk meningkatkan kemudahan penataan situs berbasis blok, tetapi dapat menambahkan sejumlah besar CSS dan SVG. Jika Anda yakin situs Anda dapat berjalan tanpa blok CSS dan "gaya global", Anda dapat menonaktifkannya di sini.','Remove WordPress block CSS'=>'Hapus CSS blok WordPress','To be able to use Critical CSS you will have to enable CSS optimization and make sure "eliminate render-blocking CSS" is active on the main Autoptimize settings page.'=>'Untuk dapat menggunakan Critical CSS, Anda harus mengaktifkan pengoptimalan CSS dan memastikan "hilangkan render-blocking CSS" aktif pada halaman utama pengaturan Autoptimize.','You can manually create rules for different types of pages or have this done fully automated on the %s tab.'=>'Anda dapat membuat aturan secara manual untuk berbagai jenis halaman atau melakukannya secara otomatis pada tab %s.','Selected reason from the above survey'=>'Alasan yang dipilih dari survei di atas','Uninstall reason'=>'Alasan pencopotan','Current website:'=>'Situs web saat ini:','WordPress version'=>'Versi WordPress','Plugin version'=>'Versi plugin','Below is a detailed view of all data that Optimizing Matters will receive if you fill in this survey. Your email address is only shared if you explicitly fill it in, your IP addres is never sent.'=>'Di bawah ini adalah tampilan terperinci dari semua data yang akan diterima Optimizing Matters jika Anda mengisi survei ini. Alamat email Anda hanya akan dibagikan jika Anda mengisinya secara eksplisit, alamat IP Anda tidak akan dikirim.','What info do we collect?'=>'Informasi apa yang kami kumpulkan?','Other (please specify below)'=>'Lainnya (sebutkan di bawah ini)','I\'m just disabling temporarily.'=>'Saya hanya menonaktifkan untuk sementara waktu.','I found a better solution.'=>'Saya menemukan solusi yang lebih baik.','It broke my site.'=>'Ini merusak situs saya.','As Autoptimize does not do page caching, you might have to install e.g. KeyCDN Cache Enabler or WP Super Cache as well. Feel free to create a topic on <a href="https://wordpress.org/support/plugin/autoptimize/#new-topic-0" target="_blank">the support forum here</a> to get pointers on how get the most out of Autoptimize!'=>'Karena Autoptimize tidak melakukan cache halaman, Anda mungkin harus memasang misalnya KeyCDN Cache Enabler atau WP Super Cache. Jangan ragu untuk membuat topik di <a href="https://wordpress.org/support/plugin/autoptimize/#new-topic-0" target="_blank">forum dukungan di sini</a> untuk mendapatkan petunjuk tentang cara memaksimalkan Autoptimize!','I don\'t see a performance improvement.'=>'Saya tidak melihat adanya peningkatan kinerja.','API Key provided by a filter, no need to enter anything here.'=>'API Key disediakan oleh filter, tidak perlu memasukkan apa pun di sini.','Clear CSS/ JS Cache'=>'Menghapus Cache CSS/JS','CSS/ JS Cache Info'=>'Info Cache CSS/ JS','Autoptimize Pro'=>'Autoptimize Pro','Autoptimize news'=>'Berita Autoptimize','Enter your CDN root URL to enable CDN for Autoptimized files. The URL can be http, https or protocol-relative. This is not needed for Cloudflare.'=>'Masukkan URL root CDN Anda untuk mengaktifkan CDN untuk file yang dioptimalkan secara otomatis. URL dapat berupa http, https, atau protokol-relatif. Ini tidak diperlukan untuk Cloudflare.','The CDN has automatically been set to make use of the image optimization CDN.'=>'CDN secara otomatis telah diatur untuk menggunakan CDN pengoptimalan gambar.','Autoptimize Pro Settings'=>'Pengaturan Autoptimize Pro','example: //cdn.yoursite.com/'=>'contoh: //cdn.yoursite.com/','How To Use Autoptimize CriticalCSS Rules'=>'Cara Menggunakan Aturan Autoptimize CriticalCSS','For path based rules, paste your specific and minified critical CSS. If you want to create a rule to exclude from critical CSS injection, enter \\"none\\"'=>'Untuk aturan berbasis jalur, tempelkan critical CSS Anda yang spesifik dan telah diperkecil. Jika Anda ingin membuat aturan untuk dikecualikan dari injeksi critical CSS, masukkan \\"tak ada\\"','How To Use Autoptimize CriticalCSS Queue'=>'Cara Menggunakan Autoptimize CriticalCSS Queue','Sorry, something went wrong.'=>'Maaf, ada yang tidak beres.','Could not add to CCSS job queue.'=>'Tidak dapat menambah antrian tugas CCSS.','Added to CCSS job queue.'=>'Ditambahkan ke antrian tugas CCSS.','Generate Critical CSS'=>'Hasilkan Critical CSS','The "Eliminate render-blocking CSS" option was activated to allow critical CSS to be used.'=>'Opsi "Hilangkan CSS yang memblokir rendering" diaktifkan untuk mengizinkan CSS yang penting untuk digunakan.','Manually process the job queue'=>'Memproses antrean pekerjaan secara manual','Could not process queue.'=>'Tidak dapat memproses antrean.','The queue is locked, retry in a couple of minutes. If this problem persists and the queue is not moving at all remove the <code>wp-content/uploads/ao_ccss/queue.lock</code> file.'=>'Antrean terkunci, coba lagi dalam beberapa menit. Jika masalah ini terus berlanjut dan antrean tidak bergerak sama sekali, hapus berkas <code>wp-content/uploads/ao_ccss/queue.lock</code>.','Queue processed, reloading page.'=>'Antrean diproses, memuat ulang halaman.','<b>This functionality will be removed in a next major version of Autoptimize</b>, being replaced by the combination of the "do not aggregate but defer JS" + "defer inline JS" options on the main settings page.'=>'<b>Fungsionalitas ini akan dihapus dalam versi utama Autoptimize berikutnya</b>, dan digantikan oleh kombinasi opsi "jangan gabungkan tetapi tunda JS" + opsi "tunda JS sebaris" pada halaman pengaturan utama.','Defer jQuery and other non-aggregated JS-files? (deprecated)'=>'Tunda jQuery dan berkas JS non-agregat lainnya? (ditinggalkan)','Lazyload images?'=>'Lazyload gambar?','Inline critical CSS?'=>'CSS kritis sebaris?','Optimize CSS?'=>'Optimalkan CSS?','Optimize JS?'=>'Optimalkan JS?','Optimize this page?'=>'Optimalkan halaman ini?','Autoptimize this page'=>'Optimalkan halaman ini secara otomatis','Automatically serve AVIF image format to any browser that supports it.'=>'Secara otomatis menyajikan format gambar AVIF ke browser apa pun yang mendukungnya.','You have "defer jQuery and other non-aggregated JS-files" active (under Advanced Settings), but that functionality is deprecated and will be removed in the next major version of Autoptimize. Consider using the new "Do not aggregate but defer" and "Also defer inline JS" options on the main settings page instead.'=>'Anda telah mengaktifkan "tunda jQuery dan file JS non-agregat lainnya" (di bawah Pengaturan Lanjutan), tetapi fungsi tersebut sudah tidak digunakan lagi dan akan dihapus di versi utama Autoptimize berikutnya. Pertimbangkan untuk menggunakan opsi "Jangan gabungkan tetapi tunda" dan "Tunda juga JS sebaris" yang baru pada halaman pengaturan utama.','Add a "metabox" to the post/ page edit screen allowing different optimizations to be turned off on a per post/ page level?'=>'Menambahkan "metabox" ke layar edit postingan/halaman yang memungkinkan pengoptimalan yang berbeda untuk dimatikan pada tingkat per postingan/halaman?','Remove Unused CSS?'=>'Hapus CSS yang tidak digunakan?','Enable configuration per post/ page?'=>'Aktifkan konfigurasi per pos/halaman?','Eliminate render-blocking CSS?'=>'Hilangkan CSS yang memblokir render?','Remove Unused JavaScript?'=>'Hapus JavaScript yang tidak digunakan?','Also defer inline JS?'=>'Tunda juga inline JS?','Load JavaScript early (discouraged as it makes the JS render blocking)'=>'Memuat JavaScript di awal (tidak disarankan karena membuat JavaScript memblokir render)','Do not aggregate but defer?'=>'Jangan agregat tapi tunda?','Queue processing time limit'=>'Batas waktu pemrosesan antrian','Optimization exclusions'=>'Optimasi pengecualian','Enable 404 fallbacks?'=>'Aktifkan 404 fallback?','Valid'=>'Valid','Invalid'=>'Tidak valid','Remove all rules'=>'Hapus semua aturan','Add CSS To All Rules'=>'Tambahkan CSS Ke Semua Aturan','Edit Default Rule CSS'=>'Edit Aturan Default CSS','Add New Rule'=>'Tambahkan Aturan Baru','Type'=>'Tipe','Target'=>'Target','Submit'=>'Kirim','String in Path'=>'String di Path','Select from the list below...'=>'Pilihlah dari daftar di bawah ini...','Rules'=>'Aturan','Rule Type'=>'Jenis Aturan','Remove'=>'Hapus','Path Based Rules'=>'Aturan Berbasis Jalur','Path'=>'Jalur','Loading critical CSS...'=>'Memuat CSS penting...','Edit Critical CSS Rule'=>'Edit Aturan CSS Penting','Edit'=>'Edit','Delete All'=>'Hapus Semua','Debug Information'=>'Informasi Debug','AUTO'=>'OTOMATIS','Options'=>'Pilihan','Delete Rule'=>'Hapus Aturan','WooCommerce Conditional Tags'=>'Tag Kondisional WooCommerce','Standard Conditional Tags'=>'Tag Kondisional Standar','MANUAL'=>'MANUAL','Export settings result'=>'Ekspor hasil pengaturan','Easy Digital Downloads Conditional Tags'=>'Tag Kondisional Easy Digital Downloads','Width'=>'Lebar','UNKNOWN'=>'TIDAK DIKENAL','Status'=>'Status','Retry'=>'Coba lagi','None'=>'Tidak ada','New'=>'Baru','N/A'=>'N/A','Height'=>'Tinggi','Get Help'=>'Dapatkan Bantuan','Delete'=>'Hapus','Creation Date'=>'Tanggal Pembuatan','Cancel'=>'Batal','Advanced Settings'=>'Pengaturan Lanjutan','Actions'=>'Aksi','ERROR'=>'EROR','- Result: '=>'- Hasil: ','Export Settings'=>'Ekspor Pengaturan','API Key'=>'Kunci API','Import Settings'=>'Impor Pengaturan','Delete Job'=>'Hapus Tugas','Images'=>'Gambar','Lazy-load images?'=>'Gambar Lazy-load?','based on status at '=>'berdasarkan status di ','based on previously fetched data'=>'berdasarkan data yang diambil sebelumnya','You have "Async JavaScript" installed, %1$sconfiguration of async javascript is best done there%2$s.'=>'Anda sudah memiliki "Async JavaScript", %1$skonfigurasi async javascript paling baik dilakukan di san