ormance even more!'=>'Autoptimize power-ups berikut dan layanan terkait akan meningkatkan performa situs Anda lebih banyak lagi!','Autoptimize\'s cache size is getting big, consider purging the cache. Have a look at https://wordpress.org/plugins/autoptimize/faq/ to see how you can keep the cache size under control.'=>'Ukuran cache Autoptimize semakin besar, pertimbangkan untuk membersihkan cache. Lihatlah di https://wordpress.org/plugins/autoptimize/faq/ untuk melihat cara menjaga ukuran cache tetap terkendali.','Autoptimize cache size warning'=>'Peringatan ukuran cache Autoptimize','Files'=>'Berkas','Size'=>'Ukuran','Enable this if you want HTML comments to remain in the page.'=>'Aktifkan ini jika Anda ingin komentar HTML tetap berada di halaman.','No items'=>'Tidak ada item','Posted %s'=>'Dipos %s','Try my other plugins!'=>'Coba plugin saya yang lain!','Happy with Autoptimize?'=>'Senang dengan Autoptimize?','Check this option for Autoptimize to also aggregate CSS in the HTML.'=>'Centang opsi ini agar Autoptimize juga menggabungkan CSS di HTML.','Also aggregate inline CSS?'=>'Juga gabungkan inline CSS?','Remove Google Fonts'=>'Hapus Google Fonts','Also aggregate inline JS?'=>'Juga gabungkan inline JS?','Settings'=>'Pengaturan','Yes'=>'Ya','No'=>'Tidak','Frank Goossens (futtta)'=>'Frank Goossens (futtta)','Autoptimize Options'=>'Opsi Autoptimize','Do not donate for this plugin!'=>'Jangan menyumbang untuk plugin ini!','Autoptimize'=>'Autoptimize','Save Changes and Empty Cache'=>'Simpan Perubahan dan Kosongkan Cache','Save Changes'=>'Simpan Perubahan','By default files saved are static css/js, uncheck this option if your webserver doesn\'t properly handle the compression and expiry.'=>'Secara bawaan, berkas yang disimpan adalah css/js statik, hapus centang opsi ini jika webserver Anda tidak menangani kompresi dan kadaluwarsa dengan benar.','Save aggregated script/css as static files?'=>'Simpan script/css yang digabungkan sebagai berkas statik?','Cached styles and scripts'=>'Styles dan scripts tercache','Can we write?'=>'Dapatkah kami menulis?','Cache folder'=>'Folder cache','Cache Info'=>'Info cache','CDN Base URL'=>'URL Basis CDN','CDN Options'=>'Opsi CDN','A comma-separated list of CSS you want to exclude from being optimized.'=>'Daftar CSS yang dipisahkan koma yang ingin Anda kecualikan agar tidak dioptimalkan.','Exclude CSS from Autoptimize:'=>'Kecualikan CSS dari Autoptimize:','Inline all CSS?'=>'Inline semua CSS?','Don\'t autoptimize CSS outside the head-section. If the cache gets big, you might want to enable this.'=>'Jangan autoptimize CSS diluar bagian head. Jika ukuran cache membesar, Anda mungkin ingin mengaktifkan ini.','Look for styles only in &lt;head&gt;?'=>'Melihat styles hanya di &lt;head&gt;?','Enable this to include small background-images in the CSS itself instead of as separate downloads.'=>'Aktifkan ini untuk menyertakan gambar-latar belakang kecil di CSS itu sendiri, bukan sebagai unduhan terpisah.','Generate data: URIs for images?'=>'Buat URI data: untuk gambar?','Optimize CSS Code?'=>'Optimasi Kode CSS?','CSS Options'=>'Opsi CSS','Add try-catch wrapping?'=>'Tambahkan pembungkus try-catch?','Exclude scripts from Autoptimize:'=>'Kecualikan script dari Autoptimize:','Mostly useful in combination with previous option when using jQuery-based templates, but might help keeping cache size under control.'=>'Umumnya berguna dalam kombinasi dengan opsi sebelumnya saat menggunakan templat berbasis jQuery, tetapi mungkin membantu menjaga ukuran cache tetap terkendali.','Look for scripts only in &lt;head&gt;?'=>'Melihat script hanya di &lt;head&gt;?','Force JavaScript in &lt;head&gt;?'=>'Paksa JavaScript di &lt;head&gt;?','Optimize JavaScript Code?'=>'Optimasi Kode JavaScript?','JavaScript Options'=>'Opsi JavaScript','Keep HTML comments?'=>'Pertahankan komentar HTML?','Optimize HTML Code?'=>'Optimasi Kode HTML?','HTML Options'=>'Opsi HTML','Autoptimize Settings'=>'Pengaturan Autoptimize']];